       // Example of proper args: \" 1 2 3\" (has a space in front) -\u003e Hence apply trim() first then split"},{"lineNumber":84,"author":{"gitID":"KeithSOC"},"content":"        List\u003cString\u003e argsList \u003d Arrays.asList(args.trim().split(\"\\\\s+\")); // split by one or more whitespaces"},{"lineNumber":85,"author":{"gitID":"KeithSOC"},"content":"        List\u003cIndex\u003e indexList \u003d new ArrayList\u003c\u003e();"},{"lineNumber":86,"author":{"gitID":"KeithSOC"},"content":""},{"lineNumber":87,"author":{"gitID":"KeithSOC"},"content":"        for (String index : argsList) {"},{"lineNumber":88,"author":{"gitID":"KeithSOC"},"content":"            indexList.add(parseIndex(index)); // Add each valid index into indexList"},{"lineNumber":89,"author":{"gitID":"KeithSOC"},"content":"        }"},{"lineNumber":90,"author":{"gitID":"KeithSOC"},"content":"        return indexList;"},{"lineNumber":91,"author":{"gitID":"KeithSOC"},"content":"    }"},{"lineNumber":92,"author":{"gitID":"KeithSOC"},"content":"    //@@author"},{"lineNumber":93,"author":{"gitID":"KeithSOC"},"content":""},{"lineNumber":94,"author":{"gitID":"-"},"content":"    /**"},{"lineNumber":95,"author":{"gitID":"-"},"content":"     * Parses a {@code Optional\u003cString\u003e name} into an {@code Optional\u003cName\u003e} if {@code name} is present."},{"lineNumber":96,"author":{"gitID":"-"},"content":"     * See header comment of this class regarding the use of {@code Optional} parameters."},{"lineNumber":97,"author":{"gitID":"-"},"content":"     */"},{"lineNumber":98,"author":{"gitID":"-"},"content":"    public static Optional\u003cName\u003e parseName(Optional\u003cString\u003e name) throws IllegalValueException {"},{"lineNumber":99,"author":{"gitID":"-"},"content":"        requireNonNull(name);"},{"lineNumber":100,"author":{"gitID":"-"},"content":"        return name.isPresent() ? Optional.of(new Name(name.get())) : Optional.empty();"},{"lineNumber":101,"author":{"gitID":"-"},"content":"    }"}